import {BrowserRouter, Route, Switch} from 'react-router-dom';
import login from './pages/login';

function App() {
  return (
  <BrowserRouter>
  <div>
<Switch>
  <Route exact path="/login" component={login}/>
</Switch>
</div>
</BrowserRouter>
  );
}

export default App;
